function NewNote(props) {
    return(
        <form>
            <input name="title" placeholder="Title" />
            <textarea name="content" placeholder="Note this..." rows="3" />
            <button onClick={props.onAdd}>Add</button>
        </form>
    )
}

export default NewNote;
